import React from 'react';

import '../App.css';

function Home() {

    return (
        <div className="ms-2 ">
            <div className="row">

                <div className="col-12  mt-4 ">

                    <a href="/AboutUs">
                    <img
                        src="/images/cover.png"
                    />
                    </a>
                    <div className="modal-dialog-centered">
                        Move to Albums
                    </div>
                </div>
            </div>
        </div>

    );

}

export default Home;
